import React, { Component } from "react";
import Project from "../components/Project";
import bricklayer_home from "../webexamples/bricklayer_home.pdf";
import bricklayer_build from "../webexamples/bricklayer_build.pdf";
import bricklayer_pricing from "../webexamples/bricklayer_pricing.pdf";
import bricklayer_customers from "../webexamples/bricklayer_customers.pdf";
import poems from "../webexamples/poems.pdf";
import quarantine_cuisine from "../webexamples/quarantine_cuisine_expand.pdf";

export default class Webdev extends Component {
  render() {
    return (
      <div className="past_landing">
        <h1 className="projects_title">
          Here are some of the projects I've worked on.
        </h1>
        <Project
          image1={bricklayer_home}
          image2={bricklayer_build}
          image3={bricklayer_pricing}
        />
      </div>
    );
  }
}
